    false,nt"url": null,nt"notes": "This narrative report for Upper Souris
    National Wildlife Refuge outlines Refuge accomplishments from May through August
    of 1960. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    fish, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, collections and receipts, vegetation
    control, and wildfires. Resource management is outlined; topics include grazing,
    haying, and commercial fishing. A progress report on field investigations and applied
    research is included. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, and violations. Items of interest,
    N-R forms, and photographs are attached.",nt"license_title": "License Not
